const ManageList = ({manageList}) => {
 
    return (
    <div className="Manage-inner ManageList">
      {manageList.map((item) => (
        <div>
         <p>{item.food}</p>
         <p>{item.kcal}</p>
        </div>
      )) }
      
    </div>
  )
};

export default ManageList;
